    "2016-04-27T00:27:22.843124",nt"name": "go-green-oklahoma-paper-savings",nt"isopen":
    true,nt"url": null,nt"notes": "<p>Go Green Oklahoma is an OK.gov initiative
    showcasing how Oklahoma eGovernment is helping to reduce the carbon footprint by
    reducing paper consumption and citizen travel  to government facilities.</p>nn<p>Currently,
    the 'Go Green Oklahoma' study provides data from online services provided by the
    state of Oklahoma. We invite state agencies to report their online services that
    reduce paper consumption and/or carbon emissions, to be included in our dataset.
     The data consists of conservative estimates limited to the date ranges of January
    2007u2013December 2010.</p>",nt"license_title": "Other License Specified",nt"extras":
